import React , {useEffect,useState} from 'react'
import Footer from '../components/Footer';
import { Formik , Form, Field, FieldArray, ErrorMessage } from 'formik';
import * as yup from 'yup';
import axios from 'axios';
import { Await } from 'react-router-dom';


const SignUp = () => {

    const formInitialSchema = {
        fname : '',
        lname : '',
        email : '',
        password : '',
        cnumber : '',
        cpassword : '',
        bname : '',
        bdesc : ''
    }
    const formValidation = yup.object().shape({
        fname : yup.string().required('First Name is required'),
        lname : yup.string().required('Last Name is required'),
        email : yup.string().required('Email is required').email('Please Enter Valid Email Address'),
        cnumber: yup.string().required('Contact Number is required'),
        password : yup.string().required('Password is required'),
        cpassword : yup.string().required('Password Not matched'),
        bname : yup.string().required('Business Name is required'),
        bdesc : yup.string().required('Business Description is required')
    });

    // const handleFormSubmit = (values) => {
    //     console.log("submitted values", values)
    // }

    // const handleFormSubmit = (values) => {
    //     const data = {
    //         Field : {
    //             fname: values.fname,
    //             lname: values.lname,
    //             email: values.email,
    //             cnumber: values.cnumber,
    //             password: values.password,
    //             cpassword: values.cpassword,
    //             bname: values.bname,
    //             bdesc: values.bdesc,
    //         }
    //     }

    //     const axiosConfig = {
    //         headers: {
    //             'Accept': 'application/json',
    //         },
    //     }

    //     axios.post(
    //         'https://rsacarbook.jaraware.com/api/v1/register',
    //         data,
    //         axiosConfig)
    //         .then((response) => {
    //             console.log('response',data)
    //         })
    //         .catch((e) => {
    //             console.log('Error',data)
    //         });
        


    // }



  return (
    <section className='signup-page'>
        <div className='sign-left'>
            <div className='left-content'>
                <h1> Hello, Friend!</h1>
                <p>Enter your personal details and start journey with us</p>
            </div>
        </div>
        <div className='sign-right'>
            <div></div>
            <div className='main-form'>
                <h2>Create Account</h2>
                <Formik initialValues={formInitialSchema} 
                validationSchema={formValidation}
                onSubmit={async (values) => {
                const data = {
                            user : {
                                fname: values.fname,
                                lname: values.lname,
                                email: values.email,
                                cnumber: values.cnumber,
                                password: values.password,
                                cpassword: values.cpassword,
                                bname: values.bname,
                                bdesc: values.bdesc,
                            }
                        }
                
                        const axiosConfig = {
                            headers: {
                                'Accept': 'application/json',
                            },
                        }
                
                        axios.post(
                            'https://rsacarbook.jaraware.com/api/v1/register',
                            data,
                            axiosConfig)
                            .then((response) => {
                                console.log('response',data)
                            })
                            .catch((e) => {
                                console.log('Error',data)
                            });
                        
                
                
                }
                }
                
                >
                    <Form method='POST'>
                        <div className='form-group'>
                            <label>Enter First Name :</label>
                            <Field 
                            type="text"
                            name="fname"
                            placeholder="Enter First Name"
                            />
                            <p className='error-msg'>
                                <ErrorMessage name='fname' />
                            </p>
                        </div>
                        <div className='form-group'>
                            <label>Enter Last Name :</label>
                            <Field 
                            type="text"
                            name="lname"
                            placeholder="Enter Last Name"
                            />
                            <p className='error-msg'>
                                <ErrorMessage name='lname' />
                            </p>
                        </div>
                        <div className='form-group'>
                            <label>Enter Your Email :</label>
                            <Field 
                            type="email"
                            name="email"
                            placeholder="Enter Your Email"
                            />
                            <p className='error-msg'>
                                <ErrorMessage name='email' />
                            </p>
                        </div>
                        <div className='form-group'>
                            <label>Enter Your Contact Number :</label>
                            <Field 
                            type="text"
                            name="cnumber"
                            placeholder="Enter Your Contact Number"
                            />
                            <p className='error-msg'>
                                <ErrorMessage name='cnumber' />
                            </p>
                        </div>
                        <div className='form-group'>
                            <label>Enter Your Password :</label>
                            <Field 
                            type="password"
                            name="password"
                            placeholder="Enter Your Password"
                            />
                            <p className='error-msg'>
                                <ErrorMessage name='password' />
                            </p>
                        </div>
                        <div className='form-group'>
                            <label>Enter Your Confirm Password :</label>
                            <Field 
                            type="password"
                            name="cpassword"
                            placeholder="Enter Your Confirm Password"
                            />
                            <p className='error-msg'>
                                <ErrorMessage name='cpassword' />
                            </p>
                        </div>
                        <div className='form-group'>
                            <label>Enter Your Business Name :</label>
                            <Field 
                            type="text"
                            name="bname"
                            placeholder="Enter Your Business Name"
                            />
                            <p className='error-msg'>
                                <ErrorMessage name='bname' />
                            </p>
                        </div>
                        <div className='form-group'>
                            <label>Enter Your Business Description :</label>
                            <Field 
                            type="text"
                            name="bdesc"
                            placeholder="Enter Your Business Description"
                            />
                            <p className='error-msg'>
                                <ErrorMessage name='bdesc' />
                            </p>
                        </div>
                        <div className='submit-btn'>
                        <button 
                        className='custom-btn' 
                        type='submit'>Sign Up</button>
                        </div>
                    </Form>
                </Formik>
                
            </div>
            <Footer />
        </div>
    </section>
  )
}

export default SignUp;
